package com.MITProjectService.bot.domain;import jakarta.persistence.*;import lombok.Data;import java.time.LocalDateTime;@Data@Entity@Table(name = "payment_logs")public class PaymentLogs {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @JoinColumn(name = "payment_id", referencedColumnName = "id", nullable = false)    @OneToOne(fetch = FetchType.EAGER)    private Payment payment;    @Column(name = "user_id", nullable = false)    private Long userId;    @Column(name = "created_at", nullable = false)    private LocalDateTime createdAt;    @JoinColumn(name = "booking_id", referencedColumnName = "id", nullable = false)    @OneToOne(fetch = FetchType.EAGER)    private Bookings bookings;    @PrePersist    protected void onCreate() {        createdAt = LocalDateTime.now();    }}